INSERT INTO `pbx_node` VALUES (1,'page','Welcome to your new AstBill-powered website',1,1,1127481652,1127577619,2,1,0,'AstBill is the perfect solution for Call Shops and smaal and large enterprises seeking to utelise or sell Voice over IP (VoIP). This brand-new system is an efficient web interface for Asterisk which allows for complete control over Price Lists, billing, customer management, voicemail, and enterprise inventory management.\r\n\r\n<strong>Please log in to the AstBill system with the following login info:</strong>\r\n\r\nUse the user <strong>astbill</strong> if you are the main administrator and have just installed this.\r\nRemember to change your passwords.\r\n\r\nMain Admin User:  <strong>astbill</strong>\r\nPassword:     <strong>demoastbill</strong>\r','AstBill is the perfect solution for Call Shops and smaal and large enterprises seeking to utelise or sell Voice over IP (VoIP). This brand-new system is an efficient web interface for Asterisk which allows for complete control over Price Lists, billing, customer management, voicemail, and enterprise inventory management.\r\n\r\n<strong>Please log in to the AstBill system with the following login info:</strong>\r\n\r\nUse the user <strong>astbill</strong> if you are the main administrator and have just installed this.\r\nRemember to change your passwords.\r\n\r\nMain Admin User:  <strong>astbill</strong>\r\nPassword:     <strong>demoastbill</strong>\r\n\r\nNormal User:  <strong>demo</strong>\r\nPassword:     <strong>demoastbill</strong>\r\n\r\n \r\nOther functionalities of AstBill:\r\n\r\nCall Data Records\r\nContact Directory\r\nWeb Based Calling\r\nHardware Inventory \"ATA, Softphone, SoftSwitch, and more\"\r\nEnd-Users Billing Prepaid & Postpaid\r\nIncomming Numbers Inventory\r\nManage Prefix and Rate Tables\r\nComplex Rate Tables and Product Branding in any currency. You can have as many price lists as you want in any currency. Each brand is linked to the user registration.\r\n','',0,1);
